sparcsSuffolk2012={};
sparcsSuffolk2012.url="https://health.data.ny.gov/resource/u4ud-w55t.json?hospital_county=Suffolk";
sparcsSuffolk2012.loadData=function(fun){
	if(!fun){fun=function(x){
		sparcsSuffolk2012.docs=x;
		sparcsSuffolk2012.tab=openHealth.docs2tab(sparcsSuffolk2012.docs)
		sparcsSuffolk2012.attrs=Object.getOwnPropertyNames(sparcsSuffolk2012.tab)
		console.log('.docs has '+sparcsSuffolk2012.docs.length+' entries')
	}}
	openHealth.sodaAll(sparcsSuffolk2012.url,false,fun)
	return this
}

s = sparcsSuffolk2012
s.loadData(function(x){
	// ini 
	s.docs=x;
	s.tab=openHealth.docs2tab(s.docs)
	s.attrs=Object.getOwnPropertyNames(s.tab)
	console.log('.docs has '+s.docs.length+' entries')
	// getting organized
	s.facilities=openHealth.unique(s.tab.facility_name).sort();
	s.CSSs=openHealth.unique(s.tab.ccs_diagnosis_description).sort();
	s.countPerFacility=openHealth.countUnique(s.tab.facility_name);
	s.countPerCSS=openHealth.countUnique(s.tab.ccs_diagnosis_description);
	// per facility_name
	s.perFacility={};
	s.facilities.map(function(f){s.perFacility[f]={docs:[],tab:{}}})
	s.docs.map(function(d){
		s.perFacility[d.facility_name].docs.push(d)
	})
	s.facilities.map(function(f){
		s.perFacility[f].tab=openHealth.docs2tab(s.perFacility[f].docs)
		s.perFacility[f].countCSS=openHealth.countUnique(s.perFacility[f].tab.ccs_diagnosis_description)
	})
	// Assemble table
	var txt='CSS description';
	// buitl header
	s.facilities.map(function(f){
		txt+=','+f
	})
	txt+='\n'
	// add rows
	s.CSSs.map(function(c){
		txt+=c;
		s.facilities.map(function(f){
			var v = s.perFacility[f].countCSS[c]
			if(typeof(v)=="undefined"){v=0}
			txt+=','+v
		})
		txt+='\n';
	})

	openHealth.saveFile(txt,'CSS count per facility.csv');
})



